package basicknowledge;

public class OrwithAnd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=20;
		int b=30;
		if(!(a==b || b!=a))
		{
			System.out.println("Or with Not Operator");
		}
		if(!(a==b && b!=a))
		{
			System.out.println("And with Not Operator");
			
		}

	}

}
